import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createDrawerNavigator, DrawerContent } from "@react-navigation/drawer";

import Vinilos from "./app/screens/Vinilos";
import Cds from "./app/screens/Cds";

const drawer = createDrawerNavigator();

const App = () => {
  <NavigationContainer>
    <Drawer.Navigator initialRouteName="Vinilos">
      <Drawer.Screen name="Vinilos" component={Vinilos} />
      <Drawer.Screen name="Cds" component={Cds} />
    </Drawer.Navigator>
  </NavigationContainer>;
};
